import React, { useEffect, useState } from 'react';
import { video_API } from './utils/constants';
import Videos from './Videos';
import { Link } from 'react-router-dom';

const VideoContainer = () => {
  const [videos, setVideos] = useState([]); // Initialize as an empty array

  useEffect(() => {
    getVideos();
  }, []);

  const getVideos = async () => {
    const api = await fetch(video_API);
    const { items } = await api.json();
    setVideos(items);
  };

  return (
    <div className='w-12/12 grid md:grid-cols-4 sm:grid-cols-1'>
      {videos.map((data) => (
        <Link key={data.id} to={"/watch?v=" + data.id}>
          <Videos info={data} />
        </Link>
      ))}
    </div>
  );
};

export default VideoContainer;
